import React from "react"

class Riset extends React.Component {
  render() {
    return (
      <div className="riset__info">
        {// Display sunrise and sunset
        }

        {(this.props.sunset === "" && this.props.sun) ? null : <p className="riset__key"> Sunset: {this.props.sunset} </p>}
        {(this.props.sunrise === "" && this.props.sun) ? null : <p className="riset__key"> Sunrise: {this.props.sunrise} </p>}
        {(this.props.moonset === "" && this.props.moon) ? null : <p className="riset__key"> Moonset: {this.props.moonset} </p>}
        {(this.props.moonrise === "" && this.props.moon) ? null : <p className="riset__key"> Moonrise: {this.props.moonrise} </p>}
        }
      </div>
    )
  }
}

export default Riset;
